INSERT INTO `art_product` VALUES (1,'Bodynest交互式居家健身可穿戴设备','胡杰','产品装备','中国','Under the influence of the epidemic, people spend less time outside, and they spend more time at home, which disrupts our original life. Less outdoor exercise results in less physical function. Many people are starting to exercise at home. At the same time, with the development of the Internet and the popularity of online live broadcasting, more and more people learn fitness through online learning and carry out fitness activities at home.\nThe rapid increase in the number of people working out has also naturally increased the chances of problems such as dizziness, arrhythmia and muscle damage due to lack of preparation, post-exercise stretching or the choice of an unsuitable intensity.\nThrough the combination of hardware and software, the program cleverly combines the process of fitness exercise with fitness protection, which ensures the safety of users during exercise to the greatest extent and avoids sports injury while users exercise scientifically. This scheme has designed three different protective tools, such as protective gloves, waist protection and knee protection, which cooperate with each other and are independent of each other.\nBecause kneepad, waist, and protective gloves are suitable for different sports. They can also detect the movement data of different parts. Therefore, while retaining the protective function of these protective devices, we can realize the correction of fitness knowledge through the analysis of a large amount of movement knowledge, which can avoid the possibility of injury to a large extent.\nThe shape and structure design of the scheme refer to the structure of castor cocoons. The semi-hollow structure solves the sweltering and binding feeling of traditional gloves and retains strong protective materials in areas with high probability of impact and injury. Through the collocation of a variety of materials, it makes the acquisition of a soft and comfortable feeling and a certain sense of science and technology. At the same time, the use of castor cocoon texture and protective combination, so that its texture has a certain characteristics and curve beauty.\nAdd the protective equipment we need to the connection with mobile devices by adding connected devices. When the user is doing various movements, the following alerts will be sent in front of the phone when the fitness protector detects excessive pressure and potential danger. The indicator light also turns red. The software also provides physical stress and injury analysis of recent sports. At the same time, the image of virtual human was introduced into the front design. Enhance the affinity of meeting, while allowing users to have a more intuitive experience.\nThe balance between \"fitness\" and \"safety\" and \"entertainment\" is highly bound. What this plan does is to lower the barrier of fitness and the possibility of injury, and make fitness really popular. In recent years, the caller platform gradually sinks, fitness can also.\nHome fitness is just one entry point, and there may be many. In order to weaken the professionalism of fitness sports, reduce the possibility of injury, and enhance its fitness and entertainment functions, only the improvement of entertainment and safety can improve the acceptance of the public. To help users build a healthy body.','hujie@gmail','2022-07-23 12:09:17.157242',1),(2,'视障群体公交车出行辅助系统','马骋协','交通工具','中国','Product name: Bus Trip Assistance System for Visually Impaired Groups Designer: Ma Chengxie， shenzhen University This design provides a travel assistance system for visually impaired people, including a personal wearable device and a mobile app, which are interconnected with the smart bus system to solve the problems of visually impaired users in the bus travel scene, improve the travel experience, and enable visually impaired people to travel independently. The hardware part of this design is a wearable navigation glove equipped with a TOF module and three vibration modules. The TOF module is used to sense and identify the surrounding environment information, while the vibration module is used to feedback on different information. Through the differentiation of the three modules, it can remind users to avoid obstacles, guide users to get on and off buses, and transmit steering information. The mobile terminal bus App BeepBeep Bus designed in this paper can help users to book buses in advance, conduct real-time navigation, and remind the driver to pick up when the user arrives at the bus station. In addition, users can also adjust the wearable device through the App, set the reminder mode in advance, and turn on the photosensitive sensor light to attract the attention of passers-by in the condition of insufficient light, so as to avoid collisions and misunderstandings. Before a trip, users can check bus routes and transfer conditions in advance through the BeepBeep Bus App, book all bus trips in advance, and add common trips for quick follow-up booking. On the way to the bus station, the user can avoid obstacles with the help of navigation gloves, accurately turn and safely arrive at the bus station. Users can send one-click reminders to bus drivers through the App when waiting the bus, so that the drivers can understand the needs of visually impaired people. When the bus arrives at the station, the user\'s navigation gloves can receive signals from the sensors on the target bus, quickly find the correct shift and boarding position, and avoid getting on the wrong bus. During the ride, the navigation system can send out a reminder of getting off in advance to avoid missed stops. This design considering the users’ difficulties in the bus trip and solve them by the design of MVP（minimum viable product）, at the same time, considering the connection between the user and the stakeholders for the design of some interpersonal interaction to meet the more perceptual experience. In addition, the design also has room for further expansion. At present, it considers the situation of bus trip, and the functions of wearable devices are relatively basic. They can be further combined with other complex systems, such as supermarket shopping system, air and railway remote travel system, scenic area navigation system, etc. It will bring more convenience for the visually impaired people to go out in different scenes.','machengxie@gmail','2022-07-23 12:19:54.229976',1),(5,'自闭症儿童体感游戏套件设计','徐雅娟','产品装备','中国','Children with autism, known as \"children of the stars\", are typically characterized by social interaction difficulties, communication difficulties, narrow interests and stereotyped repetitive behaviors. In addition, most children with autism show hypersensitivity to touch. Or sluggishness and lack of fine hand movements. Somatosensory game is a game that relies on somatosensory technology and is operated through body movements. Somatosensory games have the following three advantages in the training of autistic children\'s hand movement ability: First, it can stimulate the interest of autistic children in training. The second is to train the coordination between the hand, eye and brain to improve the effect of intervention training. The third is that somatosensory games can create a relatively safe training environment.\nThis is a somatosensory game training kit designed for hand movement training for children with autism. It consists of gloves and bracelets. The screen of the bracelet shows the status of the device. When the somatosensory kit is enabled, there will be a gradient light effect. The bracelet records the child\'s heart rate, blood oxygen and other physical data in the game. Somatosensory gloves are a medium for somatosensory game interaction. Children with autism use somatosensory gloves to grasp and rotate in virtual scenes. When wearing them, they have a sense of actual hand load. The gloves have built-in multiple somatosensory feedback shock points to achieve a real virtual tactile experience. , especially in the tactile sensitive parts of the fingertips, there are fingertip tactile feedback components, which brings children a good immersive gaming experience. The gloves can accurately capture the child\'s hand movements during the game, and judge the training effect according to the stability and accuracy of the movements. In terms of appearance design, a bionic design is adopted to imitate the shape, color and image of rose buds, implying that children are flowers that need to be cared for and ready to bloom. The fingertip tactile feedback component adopts the shape of five cartoon characters with different expressions, which is interesting. In terms of color matching, blue, which is generally preferred by children with autism, is the main color, and bright pink and green are used to increase the layering of the product.\nAutistic children interact with the game scene through hand movements and. Because autistic children have the problem of weak comprehension, the NPC character Little Prince in the game is designed. The little prince is based on the French children\'s literature \"The Little Prince\" The protagonist in the game is the prototype, and the little prince will guide the children to successfully complete the game tasks. Through the connection between the little prince and the rose, establish an emotional connection between the child and the game. In the dialogue and eye contact with the little prince, children\'s language communication and eye contact skills can be promoted.\nParents can turn on and off the device on the APP, adjust the strength of glove tactile feedback, formulate training plans, and view game records, evaluation reports, physical data and other data.','xuyajuan@gmail','2022-07-23 12:25:16.983644',1),(6,'Viber-震感挂脖音响及音乐交友APP设计','李姝源','运动健康','中国','Viber includes a Hang-neck Stereo with vibration sensors and a music social app. It aims to enhance users\' sound feedback for games and music, and bring immersive audio-visual experience to music and game lovers. Using it with the App can help users find nearby music friends and expand the scope of making friends.\n（1）Product Design:\nThe survey found that with the increase of income level, more and more users are willing to be equipped with better listening equipment. How to meet the diverse listening needs of people in different scenarios? In the game, players often focus on the picture and ignore the sound prompts, resulting in a bad experience. Can there be a device that can enhance the sound prompts to bring a better experience to the user? Taking this as a starting point, this research uses the KANO model to investigate the needs of users for listening products, and prioritizes the needs. It is concluded that the needs of not disturbing others > the need for lightweight > the need to liberate both ears > The need for comfortable wearing > the need for long battery life > the need for other additional functions. Based on this conclusion, the product design is carried out.\nSound cannot be seen, but it can cause water ripples to be seen by the eyes. How to make more parts of the body feel the rhythm of the sound? Taking such modeling semantics, the appearance design of the product is carried out. In addition, partial hollowing out is carried out to achieve the lightweight design goal. The product is connected to the mobile terminal or PC terminal through Bluetooth, and the vibration module will simulate the vibration of different frequencies according to the music rhythm or game sound effect, thereby bringing a more realistic game experience or music experience, and users can adjust the vibration and sound volume by themselves. In addition, the design of the hang-neck stereo frees the user\'s ears without disturbing others.\nThe product use process is as follows: adjust the product to a suitable size and wear it on the neck; touch the power on and connect to the PC or mobile device through Bluetooth; the vibration module converts the sound signal into vibrations of different frequencies, which are transmitted to the body through the OSCI vibration actuator ; Achieve the design goal of enhancing the user\'s music/gaming experience.\n（2）APP design:\nAPP positioning is a sharing and dating platform for music enthusiasts, Viber users and potential users. The design goal is to help users find friends nearby, expand the circle of friends, and help the Viber users to discover more potential of the product. Features include visual music backgrounds, nearby live chats, and the Viber store.','lizhuyuan@gmail','2022-07-23 12:26:26.967655',1),(7,'萌爪随身艾灸仪——基于当代技术创新的艾灸灸具设计','冯林林','产品装备','中国','Nowadays, contemporary young people pay more and more attention to health preservation, and many ancient methods that have been passed down for a long time have also been rediscovered.\nThis has also made moxibustion a hot topic in recent years, but the products on the market are mixed, and only open fire moxibustion is certified professional and effective, and improper moxibustion can also cause adverse effects. Therefore, the design of Mengzuo portable moxibustion instrument adheres to open fire moxibustion, and integrates modern technology to create a portable, easy-to-use, professionally visualized moxibustion system.\nMengzuo APP can accurately reach the lesion, specify detailed physiotherapy plans for users, provide professional private Chinese medicine-style experience, and visualize the treatment course to help users use the product better.','fenglinlin@gmail','2022-07-23 12:27:21.138134',1),(8,'360°旋转双屏智能科普学习手表','朱格','产品装备','中国','Under the background of the rapid development of science and technology, the domestic original popular science learning products for school-age children can not meet the current market situation. To solve this problem, a double screen intelligent popular science learning watch for school-age children with the theme of Shenzhen Qingqing world is designed. The watch is distributed to consumers by the staff of the park, and can be quickly worn on the wrist by referring to the wearing method of pop ring, so as to start interesting popular science learning and exploration activities.\nThe watch is mainly composed of upper and lower paper film double screens, snap ring anti-skid strap, camera, night light strap and light strap switch button. The upper screen can be turned back and forth 180 ° and the lower screen can be rotated 360 ° in the plane. The freely movable screen allows school-age children to experience the same fun as playing with toys when using the product.\nFrom the perspective of helping school-age children learn popular science knowledge, the product adds the game integral mechanism to stimulate their learning potential, so that they can better understand nature and the world in the process of playing games.','zhuge@gmail','2022-07-23 12:28:24.888306',1),(12,'交心流老人情感关怀智能穿戴产品','符敏婷','产品装备','中国','1. Product name: Cross-flow Emotional Care Smart Wearable Product for the Elderly (Smart Wearable Product Design for the Elderly Based on Semiotic Perspective)\n2. Personal Information: Fu Minting, Shenzhen University, Graduate Student of Product Design\n3. Design Notes：\nThe digital divide among older people was magnified during the epidemic, with digital integration and the inability of older people to adapt to it leading to a greater sense of internal isolation than ever before. A review of data to understand the types of loneliness and the causes and effects of it revealed that there are few products designed to address this issue. An analysis of the silver-haired consumer sector reveals that the demand for products to alleviate loneliness among the elderly has led to a \"loneliness economy\". Secondly, the analysis of competing smart wearable products reveals that existing smart products lack emotional care and fail to meet the emotional needs of the elderly. Further, using the hierarchical analysis method, it was found that the key factor triggering loneliness among the elderly is family communication, and that family communication is the primary condition for meeting emotional needs. To sum up the above research, it was concluded that the core users of the design are young elderly people aged 60-65, to meet the needs of the elderly to get care from their children, socialise with friends, leisure and entertainment, as well as to meet the needs of children to care for their parents, and to refine the functions of the product.\nThis product is established in a system where smart wearable products are linked to a small program, through which children achieve the function of communicating care with the elderly who use the device. It explores how 3d printing can meet the individual needs of the hardware product, as well as the ergonomics of the product shape to meet the psychological needs of the elderly. In meeting the basic functions, combined with theories of semiotics and nostalgia therapy, we look for symbolic applications from the elderly\'s life experience in product modelling, interaction behaviour and style. The final leap between objective sketching of unconscious design, finding connections and product symbols is completed by the lens shape of the camera, the focusing action and the traditional patterns of the new Chinese style.\nThe details of the smart devices and interactive interfaces in the product system are described below. The first part is the details of the intelligent interactive devices. The product uses multi-sensory interaction such as light and sound to allow the elderly to obtain multiple feedback; the colour scheme of the product uses low brightness colours; the product material is made of skin-friendly materials such as liquid silicone lanyards to protect the skin of the elderly. Secondly, the product\'s metaphorical volume adjustment, the reasonable hand size and the consideration of the product\'s structure.The second part is the details of the interface design. Firstly, the product interaction interface is based on the user use process to develop the page design, with an overall gradient style and warm colours. Secondly, the functions of the children\'s side are composed of communication, sharing and my. The communication module allows for multi-mode communication, with brightly coloured icons to suggest guidance. The sharing module consists of community and family circle. It can be accessed by swiping up and down. The My module\'s auxiliary functions have an intimate care function. Finally, the seniors\' interface highlights simplified content, enlarged text icons and strong colour contrast. In the communication section, voice communication and video are used to simplify communication and learning costs. A wealth of personal entertainment options and sharing alleviate the loneliness of children who are too busy to be with them, and information is accessed by swiping left and right. The My section enables emergency assistance functions and reminders.','fuminting@gmail','2022-07-23 12:32:18.749124',1),(13,'Blood Pressure','高梦琦','信息处理','中国','This is a wearable ambulatory blood pressure measuring instrument for WCH (White Coat Hypertension Patients), Blood Pressure products are designed to integrate fashion into ordinary medical products, so that the traditional ambulatory blood pressure instrument is free from boring and more comfortable to fit the human body. The product allows users to get rid of such a highly tense scene as the hospital, measure blood pressure throughout the day at home, obtain accurate blood pressure data in a comfortable and comfortable state, give users a more comprehensive list of data, connect the product with the mobile APP, express the blood pressure data through the mobile phone, the APP side will give the corresponding data analysis and condition analysis, make suggestions for blood pressure fluctuations, and provide a simple network treatment function, play a medical equipment \"early detection, early prevention\" effect, giving users a better sense of experience.','gaomengqi@gmail','2022-07-23 12:33:40.858112',1),(14,'山水熊猫','王朝霞','文化创意','中国','In recent years, Guochao has become a symbolic symbol of fashion culture. The emergence of Guochao tuyere is not only the return of Chinese traditional culture, but also the embodiment of the enhancement of Chinese cultural self-confidence. This design scheme is based on the national fashion casual shoes with 3D printing, and takes comfort, youth and diversity as the design core, hoping to hit the hearts of more consumers.\n1、 3D printed midsole for comfort\nAs most national fashion shoes on the market pay more attention to the design of appearance style, their comfort and durability are discounted to a certain extent. Aiming at this problem, landscape panda gives full play to the advantages of lean and personalized 3D printing support, and fills the lattice mesh surface and internal support of the midsole according to the stress analysis diagram of the sole, so as to improve the wearing comfort of the overall shoes.\n2、 National style three-dimensional design gives full play to Chinese aesthetic style\nShoes tell stories, and what people wear on their feet can often reflect their environment and culture. National tide fever shows people\'s recognition of national culture and the improvement of cultural self-confidence. The so-called \"national tide\" and \"country\" refer to China, which is the expression of re examining China\'s local culture, products and brands from the perspective of globalization; \"Tide\" refers to the tide and trend, which should conform to the current design context and dynamics, and has the characteristics of the tide of the times and renewal and iteration. \"Landscape Panda\" integrates traditional pattern elements and current aesthetics, making it one of the carriers of Chinese traditional culture. It shows the \"national tide\" with new design forms, new design implications and new design styles. Select typical Chinese traditional elements with universal representation - \"Chinese landscape\", \"traditional calligraphy\" and \"national treasure panda\", together with the surface national tide small decoration, the combination of tradition and trend, and three-dimensional display of Chinese traditional culture and Chinese aesthetics.\n3、 IP design helps to build the image of national fashion shoes\nIP itself has natural cultural and emotional attributes, which can quickly, accurately and ruthlessly snipe users\' pain points and attract attention to fans. As an indispensable part of the current mainstream culture, IP role can carry the function and significance of products. The combination of naive panda and trendy culture can collide with the image of overseas trendy panda IP, which will make users have a more sense of substitution and make the audience have emotional resonance.\n4、 Summary\nThe application of 3D printing technology provides new ways and methods for footwear design, and expands the dimensions of lean, intelligent and personalized. In the design and production of footwear products, from materials and texture, to structure and function, and then to appearance and form, the introduction of 3D printing technology can bring new presentation methods and create more new possibilities. It is a slight pity that the high cost of 3D printing makes it difficult for shoes, a consumer product, to enter ordinary consumers. Perhaps there is a deviation in the track they choose, or their own attempts and efforts are not sufficient. However, it is hoped that 3D printing technology can give more play to its advantages in the field closer to consumers in the future.','wangzhaoxia@gmail','2022-07-23 12:35:28.173871',1),(15,'基于3d技术的国风多材质配饰设计','吴乐仪','家居生活','中国','This design is a multi-material jewelry design based on 3D technology. The curriculum for the design exercise asks students to explore 3D technology that can be used for some sort of industrial or creative design. China is a huge trading nation for jade jewelry, which is often set in ancient costumes and hair ornaments throughout the 5,000 years of Chinese culture. Some jewelry also has the ability to ward off evil spirits and change luck, which stems from some Chinese feng shui fortune culture. Currently, jewelry companies in China are fully competitive due to a fragmented market and the presence of many small businesses. Therefore, emerging technologies could be very useful in this market.\n\nThis design aims to address three main issues. (1) The problem of reviving the ethnic style of jewelry: this segment of young women (under 35 years old) shows a great desire and spending power to buy jewelry accessories. The current jewelry designs in the market do not meet the aesthetics of young people, making the audience for such goods still too narrow. (2) Reduce the cost of ethnic style jewelry accessories: also produce jewelry with higher consumption levels, mainly using hand carving techniques, ethnic style jewelry. And generally have strict requirements for the material of the original stone, part of the corner but no one asked for. But generally young people do not have such a high level of consumption, so we need to reduce costs and improve the design content through 3D printing technology. (3) The problem of uniqueness: The industrial method of manufacturing accessories may make the accessories lack of personalization, so we need to use different materials. At the same time, we need to personalize our services by matching the different needs of users.\n\nWe design and create accessory brands using different high-tech materials and combining them with emerging scientific technologies, aiming to create new Chinese ethnic trendy accessories together with original stone materials. Our brands allow users to choose color and material combinations under specified styles and create different sparkles according to their needs. In addition, users can adapt the new Chinese accessories in multiple materials to suit their needs.','wuleyi@gmail','2022-07-23 12:36:25.109965',1),(16,'OWLED智能眼镜——基于场景智能LED眼镜设计','李冠炜','产品装备','中国','OWLed is a smart glasses designed based on the scene of nightclubs and parties, mainly focusing on its appearance design. The high modularity makes the smart glasses more possible, which is in line with the characteristics of emphasizing personality of target groups, and can also better apply 3D scanning and 3D printing.  It provides an idea for the appearance design of intelligent eyes in B - end market.  \n \nThe core point of the design mainly lies in the combination of LED layout and face scanning, which is customized according to key data such as the distance of glasses and the bridge of the nose, so as to enhance the pixel point of LED display and enhance the visual performance. ','liguanwei@gmail','2022-07-23 12:37:24.966186',1),(17,'基于 3D 打印技术的国潮助听器设计','华自忠','产品装备','中国','In recent years, guochao market is favored by young people, and 3D printing technology with low cost and high precision is increasingly sought after by business. Through relevant literature research and user interviews, the combination of medical treatment and fashion will help improve users\' self-identification psychology. Based on this, the hearing aid is intended to solve the hearing impairment of young groups of self-identification psychology, hearing aid and national fashion jewelry combined, through the visual \"hiding\" to reduce the negative psychology of wearers. Hearing aid structure mainly includes the shell, screen, hearing aid and ear part. The shape of the shell cover is inspired by the mythic images in The Classic of Mountains and Seas, mainly including min and Lu Shu. The shell cover is connected with the earhang part by magnets, which makes it more convenient to replace the shell cover. In addition, the screen pattern can also be changed through the APP.\nThe APP is divided into two parts. The first part is the accessories menu bar. The recommendation sub-page in the accessories page displays the overall wearing effect picture and brief description, so that users can quickly choose the effect they like. The secondary shell page shows the existing shell cases and introduces the design of each one, and users can choose their favorite shell cases to buy. The secondary screen page provides users with a variety of screen patterns to choose, users can choose their favorite screen patterns to match, and can preview the matching effect on the page. The second part is the equipment page and fine tuning page. The device page and fine tuning page are used to display the effect drawing and power, as well as control the switch, volume, frequency and noise reduction functions of the hearing aid. In addition, the APP also provides remote fitting functions.','huazizhong','2022-07-23 12:38:26.696623',1),(18,'Watchcats','周子建','产品装备','中国','Based on 3D printing technology, this product adopts bionic design in modeling and follows the principle of emotional design. It mainly discusses the design application in the neighborhood of wearable products based on the travel needs of pet groups and pets. The design idea of this product is to focus on the symbiotic relationship between pets and pet groups, and design a product that can not only record life, prevent pets from getting lost, but also provide video materials for pet groups, so that it can monitor the health and emotional state of pets while increasing the interest and functionality of the product, so as to ensure the healthy growth of pets.\nThe Product name is the Watchcats,the functions of this product design mainly include three points:\nFunction 1: intelligent pet seeking\nOpen the pet fun app on the mobile phone, connect the login device, click the call button, you can call by voice. When you see that you are close to the pet on the map, you can also click the call button, and the device will make a sound, so as to facilitate the search for the pet. At the same time, the positioning information is displayed, and the map software on the mobile phone is automatically opened for accurate positioning, so you can quickly find your favorite.','zhouzijian@gmail','2022-07-23 12:39:31.206933',1),(19,'Elf Guard 智能矫正器','Liu Jian','产品装备','中国','Elf Guard is a smart orthosis for posture correction and improved concentration, which mainly meets the healthy sitting needs of sedentary people and improves the efficiency of daily work. The overall shape is designed around the neck to make it more stable and comfortable to wear, thus alleviating the user\'s neck soreness. In terms of form, through the combination with headphones, it breaks through the dull impression of the previous orthosis, making it closer to fashion and technology products, so that users can wear it without pressure when they go out. In terms of functional operation, the back of the intelligent orthosis is equipped with infrared scanning and vibration sensors, which can detect and remind users of poor sitting posture and sedentary state in real time. The information is then transmitted to the main chip, collected and processed through data, and finally presented in a visual way on the user\'s mobile phone, and appropriate recommendations are given. In terms of function, it is mainly divided into three categories: normal mode, do not disturb mode, and focus mode. The normal mode is mainly to monitor and remind the user of the healthy sitting posture; the do not disturb mode, mainly used in some special occasions, to provide users with a more humane choice; the focus mode, through white noise and scientific decibels to give the user a quiet natural world, thereby improving the user\'s work and learning efficiency.','LiuJian@gmail','2022-07-23 12:40:32.469417',1),(20,'A· F Wrist protector','Liu Lan','产品装备','','First of all, my initial design inspiration is: in daily life, there are often unconsciously shaking legs, on the one hand, shaking legs will cause tables and chairs to vibrate and affect others; on the other hand, shaking legs will distract attention, affect work and study. So I wanted to use 3D printing technology to help design a leg protector that could stabilize the legs. But I wasn\'t sure what the value and significance of doing this was great, so I did a questionnaire survey with a total of 60 people, of which 40% were males, 60% were females, and the vast majority of them were 20-25 years old. The conclusion through the questionnaire survey is that ordinary people shaking their legs will not affect their lives so that they do not need to use specific products to improve, so I thought about what kind of people shaking their legs will have an impact on life, and then thought that extreme osteoporosis patients shaking their legs will cause great harm to the body, such as fractures, so I turned the direction of my research to such special groups.\nThe survey found that with the increase of China\'s elderly population, the incidence of osteoporosis is on the rise, which is a health problem worthy of attention in China and even the world. At present, the World Health Organization has listed osteoporosis, diabetes and cardiovascular disease as the three major killers that endanger the health of middle-aged and elderly people. The most common sites of osteoporotic fractures are the spine, hip, and wrist. Wrist fractures are the most common type of osteoporotic fractures in the elderly. When a person is about to fall, he will reflexively extend his palm to touch the ground to support and protect the body. At this time, the gravity of the body will be concentrated on the radius at the distal end of the forearm and fracture will occur. At this time, because the wrist is mostly in the straight position of the force, the distal end of the fracture is displaced to the dorsal side of the hand, and the wrist is viewed from the side, which will show a special spatula-like \"deformity.\" So I chose to start my design from the wrist: using 3D printing technology to help customize a wrist brace to prevent wrist fractures in osteoporosis patients. After that, I went to collect various 3D printing and wrist protector information and pictures to lay the groundwork for the later design, and then interviewed osteoporosis patients and recorded the conversation content, followed by some of the steps to be carried out in the conventional design, user portraits, inspiration plates, sketches, sketches, and so on. Next up are my product design instructions. \nPrinting the whole is composed of four parts, three gray-black parts are a palm part and two wrist parts plus a hand of the main part, the use of nylon material in hardness and toughness is strong, used to prevent the elderly daily life of the fall caused by fractures, the main part of the middle of the hollow shape can increase the wrist part of the activity area, with ropes to connect the three parts to achieve the effect of prevention. The overall size is about 88mm long, 86mm wide and 186mm high. Product name in A · F means Anti-fracture, Chinese means anti-fracture.','LiuLan@gmail','2022-07-23 12:42:03.237639',1),(21,'未来1——头戴式口罩耳机','叶克标','产品装备','中国','In the post-epidemic era, people are constantly switching between freedom and quarantine. The discomfort of wearing masks for a long time in the context of the epidemic has intensified people\'s psychological and physical pressure in life and travel.\n\nThrough the analysis and understanding of people\'s travel habits during the epidemic period. I have organically combined headphones and masks to correspond to people\'s lifestyles in different states by switching between the two states of the product. The inspiration of wearing headphones and the application of materials are also used to make masks more fit the face and improve comfort. Noise reduction and listening to music are good for decompression, and the function of intelligent AI screen makes epidemic travel more convenient.\n\nI hope this product can give people more choices and freedom in travel activities through product functions and wearing comfort in this era.','yekebiao','2022-07-23 12:44:17.710557',1),(22,'颈椎按摩风扇','吕晓云','交通工具','中国','this is for a long period of excessive concentration of energy to make the neck and muscles in a prolonged state of excessive tension, causes the cervical Vertebra Ache question to carry on the design the point massage + the fan union product. The fixed massage part of the neck is matched with the mobile massage head, which can be used for point-to-point massage in different sore areas. The position can be changed flexibly, the massage contact is more flexible, it is more accurate and effective, and you can experience a more comprehensive massage experience, make neck ache get very good abate. Can Be in the process of easy massage, relax muscles, promote blood circulation, thus to alleviate fatigue, neck and shoulder pain and other effects. With the use of a small fan, not only can effectively improve neck and shoulder pain, stiffness, but also free hands to enjoy the cool, but also can solve the epidemic during the muggy feeling of wearing a mask, make the face more refreshing.','lvxiaoyun@gmail','2022-07-23 12:45:20.871644',1),(23,'3D打印穿戴式设备设计 多用便携旅行枕','吴旻祈','家居生活','中国','This travel pillow is designed for patients with cervical spondylosis and people with long-distance travel needs. It combines both headphones and travel pillow‘s function to provide stronger support for the neck and maximize noise reduction while providing better sleep assistance. At the same time, the flexible adjustability makes the products meet different human needs. 3D printing technology is conducive not only to personalized customization and adjust the relationship between body and cushion, but also improved the quality of sleeping during travel. It also reduce daily neck fatigue, and contribute to spinal correction.\nAccording to research, I found that whether there is a good travel pillow for us to have a long enough rest when we travel by car or flying for a long time is something we have to consider in the process of travel\nThrough my experience, most popular travel pillows in the market do not have much support or fitnesses, they can’t bring a good sense of experience else. Even worse, they may bring the chance of neck stiffness and shoulder pain.\nPillow needs to support the neck without feeling suspended. The most common U-shaped travel pillow generally believes that the most balanced posture of the spine is neutral posture, it can minimize the pressure on the body. But most people don\'t keep a neutral position when they sleep. This haven’t take care of different sleeping positions, and easy to increase the burden on the neck and lower back, resulting in neck stiffness or back pain when waking up. Some people with cervical discomfort not only need functional pillows on the road but also when going out for the night, but ordinary lying down pillows and travel pillows can’t combine at the same time, and it is not practical to carry them both.\nIt is estimated that nearly a quarter of the population will have neck pain, and bad pillow design is an important factor leading to this extremely high incidence rate. Improper pillow support has adverse effects on the cervical spine, resulting in not only neck pain and cervical headache, but also ultimately poor sleep quality.\nIn particular, patients with cervical spondylosis need to choose a pillow suitable for cervical physiological curvature according to the degree of cervical spondylosis and the principle of restoring cervical physiological curvature. This physiological curve not only ensures the external muscle balance of the cervical spine, but also maintains the physiological and anatomical state in the spinal canal. At the same time, the shape of Chinese YUANBAO with soft texture and good air permeability can also play a relative braking and fixation role on the head and neck, and reduce the abnormal activity of the head and neck during sleep.\nThe depth of cervical physiological curve is measured by Borden\'s measurement method. This personalized cervical pillow can also be customized. TPU powder material is selected to avoid the problems like texture is too soft and poor correction effect. There is no personalized orthopedic planning, and soft materials will also cause the correction strength and correction results to follow suit. Choosing an inappropriate pillow size may cause neck pain or aggravation. Everyone has different cervical curvature and different cervical soft tissue conditions. Some patients are in different stages of cervical spondylosis. Therefore, it is necessary to carry out personalized 3D printing cervical pillow design and personalized correction of cervical curvature. And the elasticity of soft tissues such as tendons and ligaments around the cervical spine.\nDuring sleeping, noise penetrates the brain and activates two important areas of the brain, the auditory cortex and the amygdala, which stimulates a person\'s combat response. Especially in public transport, noise reduction can ensure better quality sleeping. In order to further improve the sleep quality, I use BBT technology to induce users to relieve psychological pressure and promote physical relaxation, so as to quickly enter the deep sleep state. In addition to the recommended mixing provided by the supporting app, users can also combine their preferences to find their own hypnotic music. Users can find their own deep and shallow sleep time zone through the sleep monitoring function. The intimate timing function solves the embarrassment that the alarm clock affects others, in public places. I deeply believes that users will feel the values of this product with every small detail.','wuhaoxi@gmail','2022-07-23 12:46:27.874757',1),(24,'可穿戴椅子——外星骇客','周燕芬','产品装备','中国','This is a chair that allows you to sit in when you want, fit the muscle curve of human legs, customized is your only, leg split design makes your legs move more freely.Break the routine, throw away the tedious tape, fixed support integration to make it more convenient to wear.\nInspired by a childhood animation —— alien hacker ghost, elegant body has a curve full of modern science and technology, the perfect combination of soft and mechanical, color inspiration from the electric light generated by the transformation, who don\'t want to have a omnitrix can become a superhero？','zhouyanfang@gmail','2022-07-23 12:47:28.928297',1),(25,'盲人可穿戴求助设备','张慧婷','产品装备','中国','At the beginning of the creation of the work, I found through interviews that people who have been blind for a long time can master the ability to travel, and the common pain point in the early stage is: fear of contacting strangers, such as being afraid to ask strangers for help (crossing the road, wait for the bus, etc.). Today, the demand for other people to look up to the blind group still exists. So, starting from the higher-level needs of the blind (respect and love), through design, I trigger other people\'s sighs such as \"Oh! It turns out that blind people are cool too\". The main target users are people who are initially blind, hoping to reduce the proportion of them receiving malicious attitudes from the outside world through design. The work uses elements of bats, its ultrasonic positioning, and the image of the world that does not rely on vision to perceive the world is more suitable for the image of the blind. It also means auspiciousness in the folk. Extract the sharp and streamlined elements of the bat for expression. Deliver the \"I\'m cool\" concept. I hope that after wearing it for the first blind, I can better feel the kindness of the world.','zhanghuiting@gmail','2022-07-23 12:48:30.690950',1),(26,'植语app','林子钰','产品装备','中国','My name is Lin Ziyu. From Shenzhen University. My inspiration comes from the internal voice of curiosity to the plant, through the principle of current induction, internal voice into plants may listen to the music, application scenario for the journey on foot, which I also about the relationship between man and nature thinking, under the age of the outbreak, we should walk into nature, found in the nature of the self redemption\n\nMy design idea is that by touching the plant, the device can produce music, because the internal resistance of different plants is not the same, by sensing different electric currents, combined with the computer to produce sound, to produce music.\n\nThe music heard during the journey is stored in the APP, and hikers can review their journey records at the end of the journey and recreate the music they have collected.\n\nIn the process of hiking, the hiker will sense the plant on the back side of the hand, and light will be emitted from the light hole in the palm to improve the interactive feedback.\n\nThe outer surface of the product is made of elastic plastic material, which is tight overall and can be firmly clasped on the user\'s hand. The surface texture has two kinds: rough and delicate. The rough side is the sensing area, and the inner surface is made of leather to enhance the wearing experience.\n\nInspired by leaves, the shape of the product is vivid and aesthetic.','linziyu@gmail','2022-07-23 12:52:13.210642',1),(27,'可穿戴输液设备','林斯翰','产品装备','中国','Design description: Intravenous infusion, as the main drug delivery in medicine? Type, is the most common in medical procedures? The treatment? No.\" But Now? The generalisations? The infusion equipment structure is simple, low-cost, to the liquid level difference for its movement? The source of so in making? There will be many inconveniences along the way. Must the patient be accompanied when he or she needs to move during infusion? An officer to accompany him, and? Lift the infusion bottle.\nTraditional infusion is with liquid level difference for move? The source of uncontrolled flow and patient infusion? It\'s