r, what gives you fitness is companionship.','wangzhudan@gmail','2022-07-23 12:57:22.659871',1),(31,'Butterfly face decoration','王普','产品装备','中国','In the moral of Venice mask, there is the meaning that wearing a mask can live with a new identity. Behind the mask, the age difference is eliminated, the old man becomes young, and the young man becomes old and cautious all at once. Young people disguise themselves as big people with the authority represented by masks. The old man tries his best to dress up as young, and even the more ignorant and stupid, the better. Men can become women and women can become men. This concept is also integrated into the face decoration design. Butterflies represent beauty and life. Butterflies are beautiful. They are gorgeous and colorful. They are floating, light and calm. Like girls, they are adorable and enviable. In folklore, after the death of relatives, they will turn into butterflies to visit the living. It symbolizes rebirth after death and the power of life. The shape of the water flow twists and turns forward, twists and turns, and keeps growing. It also adds flexible elements to the decoration. The face decoration is indeed changing, covering, decorating and replacing a certain facial feature on the wearer\'s face, transforming the appearance of the model. On the surface, it makes the wearer more confident. Born in an era when money can change appearance, is this randomness of transformation behavior a kind of technological progress? Or does it represent the morbid state of human management thinking? The whole face decoration adopts butterfly shape, which is composed of three parts: large butterfly wings wrapped around the face, four Inverted small butterfly wings and forward extending tentacles. The shape of wings is different, and the shape of tentacles is different. The part of the mask fixed on the head refers to the posture of liquid flow. The water flows in a winding, winding and undulating way, which is endless, presenting a flexible posture.','wangpu@gmail','2022-07-26 12:30:07.861790',1),(32,'蝶骨','管诺','产品装备','中国','The SPHENOID is a 3d printed knee pad wearable device. The name comes from the shape of its butterfly skeleton. The English name comes from the English word sphenoid. The SPHENOID is designed to incorporate sports equipment into people’s everyday fashion while protecting their knees during exercise. In the shape of the design into a lot of female users like the image of butterflies, in the color design used in the light luxury of champagne gold, hoping to make the product look young and energetic.','guannuo@gmail.com','2022-08-10 22:02:10.638919',1),(33,'Handy头戴式相机','糜国敏','产品装备','中国','A head-mounted sports camera designed for outdoor sports people and young people interested in smart products.\nLet outdoor athletes easily shoot sports clips and record highlights at any time.\nFree your hands, bring a better outdoor experience, and enjoy nature more deeply.\nMeet the needs of self-timer, change the form of traditional photographic aids, reduce outdoor equipment, and go into battle easily.\nAt the same time, the exercise data of the athletes are recorded, which is convenient for the athletes to know the situation of physical movement.\nThis design also hopes that more people will change their daily life and go to nature after the epidemic.\nExperience the joy of outdoor sports, feel the beauty of nature and the convenience brought by technology.\nAnd in the era of vlog prevalence, you can easily record your life.','moguomin@gmail.com','2022-08-10 22:03:44.643934',1),(35,'智能运动手套配件','肖瀚昱','产品装备','中国','With the acceleration of the urbanization process, people live in noisy and annoying cities for a long time, and the fierce competition in the cities has created a tense atmosphere, and most people need to decompress and relieve pressure. In contrast to the high-pressure environment of the rapid development of the city, people are more yearning for the relatively slow pace of 