h is used to simply scan the road conditions and serve the display; the bone conduction earphones are placed on the temples near the ears, and the switch is on the outside , One-button opening, easy to operate; the charging cord is small and convenient, easy to carry and charge, the charging port is at the position of the temple, and the interactive light displays during charging.\nHow to use: Turn on Bluetooth to connect close to the device, and the pop-up window shows that the connection is completed with one key. With the help of the mobile phone navigation app, you can quickly locate and use it. The mini display screen visually displays the distance and road conditions, combined with bone conduction headset voice broadcast\nThe overall appearance has a streamlined effect, and the point, line and surface of the plane are applied to the product design, which has a modern aesthetic feeling. The combination of dark green and technological blue is neutral, fashionable and technologically futuristic, in line with public aesthetics and suitable for the majority of users. The overall fit of the face line, the curved temples, make the glasses fit more closely to the ears, and bring users a comfortable wearing feeling.','fenlvjuan@gmail.com','2022-08-10 22:06:43.620111',1),(37,'中老年人便捷式手部护具','赵冰冰','产品装备','中国','A small, convenient wearable device that can relieve hand joint pain is mainly aimed at the main characteristics of middle-aged and elderly people with hand arthritis in their daily life, such as joint pain, enlargement and limited activity.\nBy weaving graphene into the palm and heating it with far-infrared radiation, it relieves fatigue and improves blood circulation, thereby relieving pain and stiffness in the hand. Bioelectrical signals are added to the wrist below the display to relieve pain. At the same time, the soft hedgehog structure can gradually switch between soft and hard shapes and play a supporting role to facilitate the daily life of middle-aged and elderly people. The product is equipped with a biosensor function, which is sensitive to biological substances and converts their concentration into electrical signals for detection, so that users can control the device autonomously through the biosensor to relieve the symptoms of hand stiffness and pain caused by arthritis of the hand.','zhaobingbing@gmail.com','2022-08-10 22:07:43.735647',1),(38,'Blooming canglan','赵婕秀','产品装备','中国','With the development of social economy, the subjective consciousness of young people has become stronger.More and more women are working in the workplace and working alone in the city. It is normal to work overtime and stay up late. According to the data, in 1990, China\'s population living alone accounted for 6% of the total, and by 2012, this figure reached 14%.According to the national statistical yearbook. China\'s population living alone has reached 14.6%. With the increase of the population living alone year by year, the safety of the population living alone can not be guaranteed, especially the relatively vulnerable women.The Internet is becoming more and more developed, and the news of murdered women appears frequently. Women\'s safety and health has become a social concern.So I target women aged 18 to 45:18 to 25 years old: most women in this age group are new to the society, just enter the workplace, work overtime and stay up late, often take a taxi, return home late, live alone or share rent with strangers. At the same time, they have insufficient life experience and low awareness of safety and health.25 to 30 years old: women in this age group have their own career and circle. They usually work overtime, have parties on weekends and come home late.30 to 45 years old: most women in this age group have their own families and live alone less. More emergencies are encountered.Living in the above proof, so I designed a set of jewelry tailored for girls living alone to protect the safety of girls living outside. At the same time, it is solid and beautiful + practical + functional + portable.','zhaojiexiu@gmail.com','2022-08-10 22:11:59.832690',1),(39,'蝶暖','邓欣','家居生活','中国','Design Description: according to statistics, more than 90% of women may have experienced different degrees of dysmenorrhea. Some doctors believe that the degree of dysmenorrhea, even similar to cutting fingers during delivery, will seriously affect women\'s normal life, study and work, and often this kind of dysmenorrhea is unavoidable. Therefore, I designed a warm palace product for female users for this survey. According to statistics, what girls need most at this time is encouragement and support, and one of the most effective ways to relieve dysmenorrhea is hot compress, followed by exercise or massage. The products on the market can not balance the beautiful, portable and massage temperature control well, so I found the intention balance point and designed a warm palace treasure that combines beauty and massage temperature control. In terms of modeling, the bionic butterfly shape, smooth curved surface and natural shape are adopted for design conception. There are several unique designs in function 1. Visual temperature 2. Intelligent temperature control 3. Check and adjust the online mobile app 4. Unlimited endurance 5. Intelligent massage Intelligent temperature control adopts infrared hyperthermia. In short, far infrared refers to the infrared with a wavelength of 6-14 microns. Science has proved that this wavelength is very beneficial to the human body. It can transfer heat energy to the deeper part of the human skin and promote blood circulation, so as to make the human body feel warm from inside to outside. It is with this function that the heat released by the warm palace belt can be better absorbed by the human body, directly to the pain, so as to really drive away the cold and keep warm, which is qualitatively different from the warm baby\'s skin from the outside and inside. The massage adopts the soft rubber telescopic design designed on the back of the warm palace, which can press the human abdomen, and the strength can be controlled freely. The soft rubber design can feel the combination of comfort and pressing more friendly. Online app is made for products, with simple overall function and broad direction 1. Intelligently adjust the temperature and massage intensity 2. The product features are designed for female users to warm the palace, so you can record your menstrual status and predict the menstrual time in the app to check whether it is on time or not. Generally speaking, this is a warm palace treasure designed for women\'s warm palace, which combines beautiful and fashionable appearance and temperature massage.','dengxin@gmail.com','2022-08-10 22:12:59.076423',1),(40,'3D打印传统云肩”翎云羽”','闫雨晴','家居生活','中国','The clothing or accessories made with 3D technology are very avant-garde and trendy. Although they are indeed very beautiful, I have not seen any designers who are useful. He has tried traditional Chinese clothing and accessories, and I like Chinese traditional clothes very much. Clothing, so I want to try to use 3D printing technology to make cloud shoulders in traditional Chinese clothing, because traditional Chinese clothing has only developed in recent years, but there has been no greater improvement. Everyone is looking for more ancient and more traditional craftsmanship to discover him, and the production of each exquisite cloud is very time-consuming and labor-intensive, and the construction period of one-click pure hand-embroidered cloud shoulder is about half a month. A master, pure hand embroidery. However, if you want more people to understand traditional clothing, this method will spread very slowly. And in this period of rapid development, many people are reluctant to learn about the exquisite objects left in China before. After all, it is indeed very cumbersome and can only be innovated in color and craftsmanship. So traditional things can only rely on a small number of people, because of interest to understand and inherit. But I thought about this item when I learned that 3D printing technology can make almost anything we can imagine. If you can let everyone scan their favorite items, then engineers will model and make them, and finally hand them over to 3D printers. This way will greatly attract more people to pay attention to our traditional thing. And in a very novel way, more people are willing to learn about Chinese traditional costumes. Use the most cutting-edge technology to spread the most traditional things. It is fast and novel and easy to be liked by the public. This is my thinking. I want to use this technology to let more people know about traditional things. The cloud that I want to do is just an experiment, that is to say, how it can be done, maybe it will become popular in the future, and 3D The printed material is completely different from the traditional hand-embroidered one, and there may be better innovations.','yanyuqing@gmail.com','2022-08-10 22:13:56.961092',1),(41,'Wcer','陆中杰','产品装备','中国','As we all know, smoking is harmful to health, but in people\'s daily life, many people are inseparable from cigarettes in their hands. At present, the number of smokers in the world has reached 1.1 billion, and this number is still rising year by year. Among them, China\'s smokers also reached 300 million. Such a large population base will bring many derivative problems. Cigarettes will not only harm your smokers and the people around you, but also cause serious pollution to the environment. Even cigarette butts that are not completely extinguished will cause fire and even more serious damage outdoors.\n\nStudies have shown that cigarette butts have become the most discarded solid waste. The research report published by Italy\'s national nuclear energy and Alternative Energy Agency shows that about 845000 tons of cigarette butts are discarded in a year, including about 7800 tons of dangerous chemicals.\n\nIn the face of this phenomenon, many countries have begun to pay attention to the recycling and reuse of cigarette butts. The tobacco leaves and roll paper of the recycled cigarette butts can be used as compost, and the filter tip can be processed into fine particles as raw materials for folders or ashtrays. Cigarette butts can also be used to make paper. It is an industry with good development prospects.\n\nThe full name of \"wcer\" is \"wearable cigarette end recycler\", which is a wearable portable cigarette end recycling equipment. The purpose is to remind people not to discard cigarette butts at will after smoking, and recycle them at any time through wearable devices, which is convenient for centralized treatment and reduce the pollution caused by cigarette butts to the environment. At the same time, the product also has the functions of smoking quantity reminder, second-hand smoke reminder and purification of second-hand smoke. The wearer holds the product in his hand, sets the bracelet into his elbow and fixes it, and then can complete the wearing.\n\nThe front of the product is equipped with an LED display screen, which can display the user\'s smoking quantity in a day and give a reminder at the same time. The product also has a second-hand smoke reminder function. People around can link to the device through Bluetooth to remind smokers that second-hand smoke affects others.\n\nThe middle of the product adopts the metal middle frame design, which has more texture. There is a metal key on the side to control various functions of the equipment.\n\nThe rear part of the product is the main functional area of the product, with built-in small air extraction pump and air purification filter screen, as well as a water storage box and water vapor atomization device. Their main function is to purify smokers\' second-hand smoke and extinguish burning cigarette butts. A recycling box is attached to the product. Cigarette butts can be thrown into the recycling box through the entrance on the side of the product. The recycling box is connected with the main body through a buckle, and the box cover of the recycling box is opened at the same time. The magnetic suction design is adopted to facilitate opening and closing.','luzhongjie@gmail.com','2022-08-10 22:15:15.206503',1),(43,'LISTENING','陈咏恩','产品装备','中国','As a medical device worn in human ear canal, hearing aid has high requirements for comfort. Customized hearing aid is the way to achieve high comfort. Digital technologies such as 3D printing and 3D scanning have brought accurate and efficient mass customization solutions to the hearing aid manufacturing industry.\nI borrowed the element of wings to design, and designed the buckle on the original basic hearing aid. The ordinary hearing aid is more personalized, with personalized design while meeting the functions. The detachable accessories can also meet the needs of users in different situations.\nThe key words of guard, package and freedom are absorbed in the modeling, and the following design is made in combination with some modeling of 3D printing, which makes it more secure to wrap the ear, and the accessories are detachable.','chenyongen@gmail.com','2022-08-10 22:16:49.836097',1),(44,'禳','陈晓莹','产品装备','中国','Chaoshan worship tradition as the theme of the design of a set of cultural wear jewelry. The most local characteristic of Chaoshan is the tradition of offering sacrifices to the gods. Due to the complicated ceremony of offering sacrifices to the gods, with the development of the new era and the change of the new ideological trend, some complicated details and the \"dregs\" in the traditional sense are also being removed by the local young people. However, what remains unchanged is the local cultural symbols and fond memories of hometown passed down for thousands of years. Therefore, I want to design a piece of jewelry with chaoshan worship culture as the design point, so as to inherit the unique \"tide\" culture in another form that is more suitable for young people today, and at the same time, it can also be a souvenir that foreign tourists can take away. Chaoshan sacrificial gods related items as the design point, Chaoshan sacrificial gods related items in Chaoshan has a characteristic offering called red peach next, is also a chaoshan characteristic snacks, red color strange shape and surface pattern, is very representative of chaoshan sacrificial gods. Therefore, the red peach kuih is chosen as the representative object of the main design. In the temple will be lit bamboo lanterns, some people will be on the table to worship god lanterns, with a sense of festival and lively atmosphere. Sacrifice to god will generally use incense to worship, is the representative of the sacrifice to god. The porcelain inlaid on the roof of the temple is vivid in color and shape. Porcelain inlay a wide range of themes, using heroes and famous officials in history and folklore, literati, to reflect the people\'s positive pressure evil, brave and enterprising spirit, to inspire and inspire people; Or the use of auspicious, rich flowers, insects, birds and animals, to create auspicious, longevity, luck, wealth, harmony and other simple folk feelings rich artistic atmosphere. Necklace form reference gem, gem: ancient beads and jade string ornaments, mostly for the neck decoration, gem was originally an ancient Indian Buddha neck decoration, later with the introduction of Buddhism to China, the Tang Dynasty, was the beauty of women seeking new imitation and improvement, become a necklace. \n  The earpiece is integrated with 3D printing technology, which is hung on the ear with the radian of the ear, and fits the ear shape without ear holes.\nSelect the shape of red peach kuih combined with the characteristics of porcelain inlaid on the temple roof design elements; Lanterns for the prototype, cylindrical beads are designed, the middle of the incense as the prototype and lanterns in the middle of the fire converted into beads, string into pendants; The curve formed by the smoke after the incense is ignited has an elegant and leisurely beauty, which is designed as the frame of the collar.','chenxiaoying@gmail.com','2022-08-10 22:19:33.156693',1),(45,'蝠蝠蝠','陈裕明','产品装备','中国','In ancient times, the bat pattern was favored by the emperor. It is not surprising that the so-called what is good at the top, what is good at the bottom became popular among the ancient dignitaries represented by Prince Gong. From the palace to the people, from the south to the north, according to the concept that the decoration must imply auspiciousness at that time, a large number of bat patterns appeared in people\'s clothing, food (pattern modeling) and transportation. They were the best auspicious patterns of the ancients, carrying the prayers for happiness, longevity and peace and the pursuit of happiness and auspiciousness in traditional Chinese culture. Because bats are homonymous with the Fu of Fuqi, there are a large number of works made of bats in the Forbidden City. Therefore, I choose to use bats as the main element of my product, and then abstract bats to become more modern. At the same time, there is no lack of the original beautiful meaning of bats. Let the Forbidden City and modern better combine together.The earrings originated from the red bats on the robes of Emperor Qianlong of the Qing Dynasty. They have the meaning of Hongfu. The Hong and red are homonymous. From red to red fire, these three bats form the shape of fire. In terms of shape, a bat perches on a peach. The peach has the beautiful meaning of longevity in traditional culture. The integration of bat and longevity peach has the meaning of more happiness and longevity.','chenyueming','2022-08-10 22:20:33.067138',1),(46,'枫的低语','黄凝儿','产品装备','中国','Interpreting new ideas from the leaves in nature, each leaf germinates in nature, matures in nature, and then returns to nature. It is an indispensable part of the process of self construction.\n\nWith the acceleration of social rhythm and the continuous entry of new materials and new ideas, the boundary of jewelry becomes more and more blurred. In addition to traditional precious metals, jewelry materials, silica gel, plastic and so on. In order to meet the increasingly rich personalized needs of consumers, various jewelry accessories came into being, and 3D printing technology can not only provide greater design freedom, but also fully customize the design, meet the customization, and carry out one-time production economically and efficiently. 48 questionnaires were collected in the early stage of design. The results show that the wearing rate of necklaces and earrings is the highest, and I hope the jewelry is special and relatively low-key.\nIn the design direction, it should be personalized and customized with 3D printing technology. It mainly focuses on the design and research of structure, adopts the structural modularization mode and element sharing, creates different uses and different connection modes with similar and the same structural modeling, tries a variety of combination modes: track, intersperse, stretch, overlap, hollowing out, texture, etc., and designs a modular, multi combination jewelry that is different from traditional jewelry. It is hoped that users can create a semi DIY way of interaction and thinking by themselves, which can inspire users to discover themselves, explore their true self, and start a dialogue with themselves and an interaction with nature.\n\nThis work is made with 3D printing technology and takes the maple leaf in nature as the design prototype. It is the most natural and original image. It is intended to explore women\'s definition of self, face self, know self, discover self, accept self, inspire users to think about self, talk with themselves and whisper to nature. Named \"the whisper of Maple\", we also hope that users can face life with a natural and free mind, just like walking in the shade of autumn, with the wind blowing the trees, the fallen leaves in the body, talking to the wind and whispering with the leaves, which can be cured by nature and the fallen leaves in the heart.\nContinuous improvement in modeling, from plane to three-dimensional, from floating to rigid, from sharp to round, to create a light and beautiful, but also tenacious and powerful female image. Finally, a modular jewelry with a certain sense of elasticity and weight can be formed.\nThere are two pairs of earrings and a collar. Based on a single structure, resin 8000 is selected for printing to maintain the white, pure, natural and unmodified color of the model and highlight the structural content of the product. A total of 12 outwardly convex pieces (single piece length: 45mm;) are printed on the collar, The wearer can reduce or increase the number of wearers according to the desired length and elastic effect; A total of 8 inwardly concave earrings are printed, including 6 small ones (45mm) and two large ones (55mm), which can be worn freely according to personal preferences.','huangninger@gmail.com','2022-08-10 22:21:26.622996',1),(48,'运动臂包','黄米欢','运动健康','中国','This product is a sports arm bag. Its main function is to let sprinters carry some basic items, such as mobile phones, cards and paper towels. This product is designed because most of the sports arm bags on the market are similar, and the shape is not good-looking enough. While adding functions, the aesthetics will also be reduced. Many people have been investigated, and the aesthetics of the arm bag directly determines whether they will buy this arm bag. Therefore, using the technology of 3D printing and the structural characteristics of 3D printing, we explore a sports arm bag with different modeling structure and increased aesthetics.\n\nThe material of the sports arm bag mainly adopts silica gel material and Velcro. The front bag body uses silica gel material. The characteristics of high temperature resistance and shock absorption can protect the athlete. The soft and non deformable characteristics can make the arm bag fit the arm better, and the surface is made of frosted material, which can make the mobile phone easier to put and take. The back strap uses Velcro, which allows users to freely adjust the tightness and allow more different people to use it. Finally, in terms of color selection, it provides users with three series of color matching to meet the needs of different styles of the public, including gradient color system, dark color system and fan color system. In terms of color selection, it selects a more dynamic and dynamic color matching.\nConclusion: the design of this arm bag aims to combine new technology, find new structure and new materials, no longer stick to the popular style on the market, and explore sports products in the new era.','huangmihuan@gmail.com','2022-08-10 22:28:56.698014',1),(49,'《汉尼拔》概念珠宝设计','胡佳荟','产品装备','中国','This is a conceptual jewelry designed based on the discussion of the relationship between the two roles in Hannibal. I designed a pair of earrings and rings.The two characters in the play are lovers. One is a high IQ criminal and the other is a smart agent. Because they know each other, they find the inner essence of each other after going through a lot of things, and then attract each other and fall in love.In the design of earrings, I adopted the concept of upside down. In terms of color, red and white are combined. I exaggerated the design of the shape of the eyes, and used red transparent materials as eyes for embellishment. The right ear is on the eye. It means that in the play, the role is on the side of the leader at first, and this role is high above all; The left ear is with the eyes down, which indicates that the role is initially on the side of the guided person. This role is not firm. The two have been testing each other and examining each other, and their fate is intertwined. In this process, the relationship is sometimes close and sometimes alienated. Therefore, in addition to the eye decoration, I also use regular but inconsistent sheet decoration for arrangement, in order to express the stability and instability of the relationship between the two through subtle details.In the design of the ring, I adopted the design method of imitating the growth of the bone cone, in which the left ring grows positively and the right ring grows inversely, implying that the two are in a black and white relationship. Nevertheless, they are deeply attracted by each other and come together in a bloody, strange, but affectionate way to produce love, just like in my design., The direction of the two rings is almost to touch each other. The growth and touch of the two bone cones are like walking into each other\'s deepest heart.I think the story between the two characters is the most dangerous and charming love story. Putting aside the elements of bloody violence in the play, I only absorbed the characteristics of aesthetics and love and explained my view on the love between the two characters with my own understanding.','hujiahui@gmail','2022-08-10 22:32:05.789673',1),(50,'余光·增强现实导航眼镜设计','莫颖儿','产品装备','中国','On daily trips, whether cycling or walking, there are always dangerous accidents due to looking down at the mobile phone, turning back and suddenly rushing out of the vehicle.\nThis is an augmented reality navigation glasses. In addition to navigation, the sensors and cameras equipped with it can also detect the vehicles and pedestrians of all parties in real time, maintain a safe distance and greatly improve the safety of travel.\nUse manual knob and key interaction or eye movement interaction to travel considerately.\nThe use of 3D printing technology can reduce unnecessary assembly, reduce material waste, green environmental protection and break through technical restrictions, open up a huge design space, meet the wearing needs of all kinds of different people, and customize glasses.\nCool colors meet the aesthetic needs of young people and become a fashion trendsetter in life.','moyiner','2022-08-10 22:33:43.087750',1),(51,'海浪','许钰涵','产品装备','中国','Product name: waves design description: global warming, the temperature rise, exceptions, and sea levels rise faster. Due to the continuous accumulation of greenhouse effect, energy continues to accumulate in the earth and air system, causing almost all glaciers in the world to retreat. Global sea levels are rising faster than in any century in the last 3,000 years due to the thermal expansion of the oceans and the melting of ice sheets. Global warming continues, sea level rise is irreversible, and will even cause a devastating blow to global living things. Therefore, according to the global temperature rising sea levels caused by the changes to design a set of necklace and bracelet. The design combines the characteristics and advantages of 3D printing technology, increases the regular ripple, makes the necklace shape more flexible, but also hopes that people can pay more attention to the protection of the environment.','xuyuhan@gmail.com','2022-08-10 22:35:02.894866',1),(52,'平安胸坠','谢家豪','产品装备','中国','In Chaoshan, the vast majority of the masters worshipped in all temples are Taoist gods. Due to the secularization of the master, the people hope that the master can bless all day, so the \"master talisman\" has become a folk custom. Master Fu is not superstition, it is a spiritual sustenance of Chaoshan people, and it is also another kind of love and concern of Chaoshan parents and parents for their children and grandchildren.\n\nWith the development of the times, today\'s young people don\'t bring or understand these things. In order to better retain the safe tradition of Chaoshan, many designers design the safe symbol as a wearable product in line with the views of young people,\n\nAccording to the cultural characteristics of Chaoshan Lantern Festival, taking Chaoshan safety culture as the creative point, we use 3D printing technology to design a wearable safety jewelry cultural and creative product in line with the traditional style of young people\'s point of view.','xiejiahao@gmail.com','2022-08-10 22:36:18.882816',1),(53,'手环','谢彤','产品装备','中国','My design is a steampunk-inspired jewelry design, my final plan is the combination of the elements of the previous sketches, the mechanical wings are simplified to the jewelry, I want to reflect the beauty and freedom of the machinery for that era, with the placement and splicing of the gears to reflect a mechanical splicing and arrangement, the overall jewelry wants to show the elegance and romance of the mechanical sense, and the middle part of it is outwardly unfolding. And for the sake of three-dimensionality, the outside of the ear also has a fixed structure, and the decoration above the earhook is inspired by mechanical airships, which is the idea of combining the overall design concept.\nMy second design is a bracelet that I designed according to the earring reference, the bracelet has two worn together, the two bracelets are inspired by the gear machinery, the black bracelet has a similar screw, the whole is to reflect the combination of a gear, and the two bracelets have a free place to take it off or put on.','xietong@gmail.com','2022-08-10 22:37:20.332186',1),(54,'排球文化珠宝套装设计说明','彭世龙','家居生活','中国','The elements in this set of jewelry are extracted from the five core technologies of volleyball, including serving, setting, blocking, digging and smashing. It was designed in combination with the ball shape of mikasa-v200w and mva200, which are most widely used in two professional volleyball competitions. BLOCKING·EARRINGS Among them, the earrings are inspired by the technical action of blocking in volleyball. When blocking volleyball, you need to open your hands and press your wrists down, wrap the ball between your palms, like closing the ball in your palm. When volleyball circles describe the blocking action standard and good effect, they often say The door is closed. UNITED·RING The inspiration of the ring comes from the collective spirit of volleyball. The wind blade around the ring jewelry extracts the mikasa-mva200 volleyball known as the Yellow whirlwind. Volleyball is a collective sport played by six people on the field. The six blades hold up the ball in the middle, which symbolizes that the six athletes support each other, make up for each other and work together to play a good ball. DIGGING·NECKLACE The necklace is inspired by the digging technique in volleyball. When digging the ball, you need to overlap your palms, stretch your wrists, and dig the ball out with your forearm. The necklace extracts the segmented spherical slice from mikasa-v200w volleyball. It looks like a palm, overlaps it, holds up the ball and looks like a ball cushion. SETTING·BRACELET The bracelet is inspired by setting. When setting a volleyball, you need to hold your hands in front of your forehead, open your palms in a semi arc, and the main force producing index finger and thumb are in the shape of EIGHT AND ONE, hold the ball and bounce it out. Inspired by this, this bracelet designs the intersection of bracelets as EIGHT AND ONE shape, holding the ball (i.e. jewelry) in it.','pengshilong@gmail.com','2022-08-10 22:40:39.178589',1),(55,'日月坠-水火戒-文武链','戴诗洁','产品装备','中国','It is the collision between traditional culture and modern design that works are created by combining heaven, earth and man. It not only conforms to the traditional beauty of oriental women, but also shows the lively feeling in fashionable life. The new \"newness\" of Chinese style is not only a purely formal newness, but also penetrates into the cultural connotation and the overall harmony of various elements. Works blend into nature, follow the laws of all things, and create a harmonious aesthetic feeling between man and nature.\n\nThe sun and moon earrings\n\"Sun\" in Oracle Bone Inscriptions, some of them look like a round sun. The Oracle Bone Inscriptions shape of the \"moon\" reflects the typical feature of the lack of the moon as the normal state.\nThe stars are headed by the sun and the moon, and combine the sun and the moon together to make them bright, meaning bright. The sun and the moon come out and never die.\n\nThe fire and water ring\n\"Water\" is pregnant with life, \"fire\" is the source of culture, and the ancient Oracle-bone culture continues slowly between water and fire.\nTwo elements are indispensable between the earth. This ring combines water and fire, expressing the idea that water and fire are in harmony and endless.\n\nThe gentle and valiant necklace\nWen and Wu, one soft and one firm, \"Wen\" is like a standing human figure in Oracle Bone Inscriptions. , while \"Wu\" is a pictogram of marching for people.\nCivil and military, dynamic and static combination. A chain designed by combining civil and military skills, everyone\'s special skills are different, and their skills and skills must be used.','daishijie@gmail.com','2022-08-10 22:50:08.664100',1),(56,'竹子元素的首饰','方彤雯','产品装备','中国','Bamboo is the material carrier of Chinese virtues and the symbol of a gentleman. It is loved by countless people with lofty ideals. Ancient and modern scholars praise bamboo and leave a large number of bamboo poems and paintings. The earliest bamboo plot of Chinese people can be traced back to the Wei and Jin Dynasties. After that, bamboo evolved from a cultural significance to a folk image.\n\nIn Chinese tradition, bamboo symbolizes the elasticity, longevity, happiness and spiritual truth of life. Bamboo, elegant and charming, slender and soft, evergreen and invincible, symbolizes eternal youth and youth; In spring (spring mountain), bamboo is natural and unrestrained, tall and straight, beautiful and handsome, and elegant gentleman demeanor; Bamboo is hollow and symbolizes modesty. The character of bamboo is modest and self-sustaining. The characteristics of bamboo bend but do not bend and bend continuously, which symbolizes the principle of being a man with softness and hardness. Lingyun intends to be strong, wind and snow, and the bamboo will be exposed, and the bamboo tip will be raised, which is a metaphor for high integrity; Noble moral character, born with integrity, is regarded as a symbol of integrity.Zhang Jiuling chanted bamboo in Tang Dynasty, saying that \"people in high festivals attach importance to each other, and the world knows with an open mind\" (chanting bamboo with Lu Shilang of Huangmen). Indifference, lofty and integrity are the personality pursuit of Chinese literati. Yuan yangzai\'s \"ink bamboo\": \"the flavor is indifferent, and the color is not beautiful. There is such Lingyun gas among the lonely cliffs and valleys.\"','fangtongmin@gmail.com','2022-08-10 22:52:27.084160',1),(57,'E-pancreas闭环人工胰腺系统','李柏嘉','运动健康','中国','Design Thinking: E-pancreas closed-loop artificial pancreas system is a system built for diabetes patients from a new perspective, which is different from the previous artificial pancreas system in that the innovation of dynamic blood glucose monitor in the system -- the earlobe tissue near infrared spectral dynamic blood glucose monitor developed by the existing cutting-edge technology, non-invasive blood glucose monitoring. The variation trend of blood glucose concentration in earlobe capillaries was basically the same as that in whole blood of forearm vein and fingertip capillaries, with correlation coefficients above 0.8. Therefore, it is feasible to use earlobe as a measurement site for blood glucose detection from a physiological perspective. The overall appearance takes fashion and beauty as the standard. It is equipped with the application catheter-free insulin pump and automatic insulin infusion operation software, which not only protects the privacy of diabetes patients, but also creates a more comfortable and free life for them.','libojia@gmail.com','2022-08-10 22:56:48.616127',1),(58,'虚拟交互式颈部按摩器','李皖苏','产品装备','中国','In addition to retaining the original neck massage function, the virtual interactive neck massager adds such a virtual interactive setting that can interact with progressive blood vessels and muscles. It is mainly a future-oriented interactive design product. When the future comes, the communication between human beings has become more blocked for various external reasons. From the Internet to the meta universe, we advocate to the meta universe, we advocate the establishment of an online utopia for human beings. There is no life or death, no rich or poor, and all racial discrimination and ethnic antagonism can be eliminated here. A sustainable social state can be developed. But human beings are ultimately a single organism, not a string of code, and human beings will eventually go out of virtual space and enter the offline world. The virtual interactive neck massager mainly provides a more trendy and science fiction interactive way for human beings. It can not only massage when relaxing, but also wear it out of the house. Among the same crowd, the surrounding virtual lights will transform different lights with the mood and mood of the human body, forming a kind of Non-linear intelligent interconnection, which seems irrelevant, but closes the relationship between people, may be a more advanced way of communication in the future.','liyuansu@gmail.com','2022-08-10 23:00:05.952975',1),(59,'拥抱时彼此在耳边呼吸','李舒亚','产品装备','中国','The jewelry uses 3D printing technology, and its shape can perfectly fit the human body structure, and we have been walking together in those stormy days. This earring is divided into three parts, the upper part of the melted metal, the texture of the metal expresses the hot breath when in love, the melted beauty expresses the softness and warmth of the heart when in love; the middle part of the designer uses the form of glass beads to connect together, under the background of the metal, the glass beads give people a sense of breathing that seems to be nothing, haunting the ears; the lower half adopts a regular shape, which means that it is a shoulder that you can rely on, giving people a sense of solidity. The design with the lines behind the ear is an expression of the entanglement of two lovers who do not abandon and embrace each other. Hopefully, we can all be able to rely on each other in love.','lisuya@gmail.com','2022-08-10 23:02:37.713066',1),(60,'可柔矫姿器','杨晓靖','产品装备','中国','This posture corrector is inspired by coral on the seabed.Coral is soft when living in water, but it also has a certain supporting force, which can protect animals symbiotic with coral.The posture corrector also plays a protective role for the body.Coral has been used as ornaments since ancient times. It has been endowed with many beautiful meanings by the ancients and is regarded as a thing of good luck and happiness.\nThis posture corrector can be worn in two ways.It can be worn as a belt or brooch.The straightener has a relatively gentle radian, so that the posture corrector can better fit the body.The outer frame and sensor can be separated and fixed through the snap on the top.The overall material is matte plastic, which makes the overall weight lighter and reduces the burden on the body.','yangxiaoqing@gmail.com','2022-08-10 23:04:19.836999',1),(61,'自我','杨运倩','产品装备','中国','As a person who loves street culture and is deeply involved in it, purity is an extremely important quality. The commercialization of skateboarding may make those skateboarders who really play skateboarding unable to afford skateboarding, clothes and shoes. A negative news from hiphop may make those rappers or beat producers who have really worked hard lose their money. Those writers who play graffiti won\'t care about the feelings of outsiders. We are just ourselves and stick to what we love!\nThis street culture represents a different attitude towards life. The design of wearable 3D printed jewelry integrates street cultural elements, breaks through traditional ideas, and has a new way to show the personality and pursuit of young people, so that more people can understand and accept street culture, and people who love street culture can be understood and approved by more people.','yangyunqian@gmail.com','2022-08-10 23:05:22.576071',1),(64,'The Gale Calamity','Xia Qian','文化创意','中国','Legend has it that in ancient times, the nobility and royal family lived in extreme decadence, while the common people suffered terribly. During this era, an evil dragon resided in the sea, causing widespread chaos. Despite this, no officials or nobles were willing to intervene; they remained lost in their revelries. A man from the north, with the help of a celestial being, rose to the occasion, gathering popular support to seal the evil dragon within an artifact. Using the dragon’s power, he punished evil, promoted good, pacified the land, and established peace, thus forming a prosperous nation. It was said that whoever possessed the bracelet would rule the world. However, this did not bring tranquility; instead, countless conflicts arose in pursuit of this artifact. Eventually, the seal on the bracelet weakened, and the dragon was released, returning directly to the celestial realm without wreaking further havoc on the world. Thus, the struggle for power continued; gaining the dragon’s essence was merely a pretext for justifying the claim to the throne. In the end, whether the dragon was the true evil or whether the calamities were man-made remains unknown. The tribulations endured by the world, whether caused by provoking the dragon clan or human ambition, are left to history. This bracelet, known by later generations as “The Gale Calamity,” carries the name of this tumultuous legacy.','luojing@szu.edu.cn','2024-06-04 19:55:32.040875',1),(65,'Loop','Feng Zhuoming','文化创意','中国','Everyday we repeat certain activities, just like the sun rises and the moon sets in an endless cycle. Regardless of whether a day is good or bad, the cycle continues. May you find someone special to share this journey with you, over and over again.\n\nThis design is a necklace pendant, featuring three circles forming a stable triangle. Within these circles, three crescent moons are gently embedded, symbolizing a stable and cozy warmth.','luojing@szu.edu.cn','2024-06-04 19:59:44.465837',1),(104,'Thousand Knots','Song Liling','产品装备','中国','\n“Thousand Knots” Wedding Jewelry Series\n\nThis collection is designed for the Chinese wedding market, targeting individuals aged 25 to 35 who are at a marriageable age. It blends rich traditional Chinese elements into a concise and cheerful design style. Simplicity is a fundamental demand of modern design, enhanced with moderate traditional decorative elements. Modeled after the appearance of Chinese knots, each piece in the series is named according to its shape and meaning, crafted entirely from a single thread.\n\nSeries 1: The “Wan Zi Jie” Knot\nInspired by the “Wan Zi Jie,” a type of Chinese knot. The character “万” (Wan) is often written as “卍.” Originating from Sanskrit and pronounced as “man,” this symbol signifies abundant blessings and good fortune. When the “卍” character extends horizontally and vertically into intertwined patterns, it symbolizes eternal continuity. This decorative motif is hence called “wan zi jin” (卍 pattern).\n\nSeries 2: The “Double Coin Knot”\nInspired by the “Double Coin Knot,” where “link” (联) denotes connection, cohesion, and unending continuity. This knot comprises two individual knots intertwined, thus named “Double Coin.” In Chinese auspicious expressions, the terms “link” and “connection” can subtly imply continuous success, perennial abundance, and successive academic achievements.\n\nSeries 3: The “Panchang Knot”\nSymbolizing the unity of heart and mind, it is also known as the “Panchang Knot.” In ancient poetry, it was used to describe deep longing for one’s distant homeland, illustrated in verses such as, “Adorn it with everlasting thoughts, and tie it into an inseparable knot. Once melded with glue and lacquer, who can ever part it?” This knot metaphorically represents deep, inseparable affection.\n\nSeries 4: The “Pipa Knot”\nThis series features gold claw-set jadeite, regarded in China as an auspicious object with the power to ward off evil and misfortune. Jadeite is a treasured gemstone, believed to protect its wearer from harm and extend life. Gifting or wearing jadeite jewelry is a symbol of fidelity in love, embodying qualities of beauty, depth, and stability.\n\nSeries 5: The “Double Coin Knot”\nNamed after the resemblance to two ancient copper coins linked together, symbolizing “double happiness.” Historically, coins (qian) were referred to as “qian,” which homophones with “completeness” (quan). Hence, the double coins imply “double completeness.”\n\nSeries 6: The “Flat Knot”\nInspired by the “Flat Knot” the most common and practical knot. The term “square” implies equality and balance. It also signifies conquest and stability, like pacification and stabilization, conveying a sense of being well-grounded. There are many auspicious phrases containing the word “square,” such as “longevity and peace,” “double longevity and fortune,” “prosperity and peace,” and “rising steadily to the top.”','luojing@szu.edu.cn','2024-06-04 21:28:57.909001',1),(105,'The first branch','Zhang Manlin','产品装备','中国','“The First Branch Grazing the Shoulder”Inspired by a memorable scene from the movie “Cinderella,” where Cinderella shares an unforgettable moment with her father. He brings back the first branch that grazes his shoulder, symbolizing his endless concern for her during his long journey. The first branch carries love and longing. From mountains to oceans, plains to islands, the solo journey is both arduous and wondrous. Whenever she sees the first branch, she will think of him. The longing solidifies into dazzling red spinel gemstones, hanging from the branch. The beautiful light reflected from its 71 facets resembles shimmering lake waters and mottled sunlight. I want to share every beautiful scene I see with you. This delicate emotion transforms the rough branch into soft silk, gently encircling you. The combination of diamonds and red spinels draws inspiration from Tiffany & Co’s high jewelry collection. The stark color contrast of these most precious gem materials conveys a strong sense of emotion. The asymmetrical design of the necklace is inspired by Boucheron’s Question Mark series, combining the flowing lines of Art Deco style with modern minimalism. The connections between the four branches and the main branch are seamlessly joined using circular arcs with different radii to ensure the overall fluidity of the lines.','luojing@szu.edu.cn','2024-06-04 21:30:02.159218',1),(106,'Caisson','Yao Mengyuan','产品装备','中国','The term “Caisson” refers to the highest and most central part of a Buddhist temple’s architecture. In layman’s terms, it is essentially the “ceiling of the Pure Land.” In ancient Chinese architecture, many structures were made of wood, which was susceptible to fire. To mitigate this, patterns resembling water plants were painted onto the roof structures, symbolizing that “there is water here, so it won’t catch fire.” This practice reflects the concept of the Five Elements: metal, wood, water, fire, and earth, which are believed to generate and counteract each other. Such designs also embody the ancient aspiration for a harmonious life. The wooden beams were arranged in an upward, inverted-dome shape, resembling a large, intricately painted well cover, which over time evolved into the beautiful art form of caisson patterns.\n\nThe necklace draws inspiration from the small motifs found in the caissons of Dunhuang. It incorporates the auspicious patterns of Dunhuang caissons as its foundational shapes, which are then interconnected and curved to form the design. The use of gold as the background color imparts a sense of nobility and grandeur, combined with an aura of mystery and sanctity. The result is a piece that exudes both sophistication and luxury.','luojing@szu.edu.cn','2024-06-04 21:31:23.612221',1),(107,'Eye','Guo Yilu','产品装备','中国','The design concept is inspired by the psychological experience of every individual in their daily life. No matter what one is doing, there is always a feeling of being watched, evoking a sense of suspicion. Thus, the primary element of this ring design is the eye (represented by black gemstones). Each side of the ring features ten black gemstones, symbolizing the need to moderate one’s suspicions and recognize that their current life is actually near perfection. The material used is primarily 14K gold, which signifies the wearer’s status as a successful individual. Traditionally, the color yellow is associated with prosperity, signifying wealth and success. This is a personal ring. The black and yellow color scheme creates a stark contrast, making the material immediately identifiable to the observer at first glance.','luojing@szu.edu.cn','2024-06-04 21:33:08.249755',1),(108,'Blue Summer','Xu Qianwen','产品装备','中国','The “Blue Summer” collection features three pieces: a necklace, a long necklace decoration, and a pair of earrings. The inspiration behind this collection comes from my personal dislike for the summer heat. I wanted to create jewelry that evokes a sense of coolness when worn in summer, reminding people of clear lakes or blue oceans.\n\nThe first piece is named “Lil Goldfish,” which is a necklace pendant shaped like a small goldfish. The entire pendant is made with a silver base and features a baroque pearl embedded in the center. The two eyes of the goldfish are adorned with tiny pearls. The tail of the goldfish is designed with an openwork mesh pattern, capturing the graceful movement of the tail when the goldfish swims.\n\nThe second piece is named “Leaf,” which is a slightly longer necklace decoration that can also serve as a sweater chain. The entire chain features an alternating pattern of pearls and pendants. The blue parts are smooth cabochon gemstones, and the bottom decoration is inspired by the shape of a curled leaf. Enamel material is used to achieve a translucent effect, enhancing the overall aesthetic beauty.\n\nThe third piece is named “Wing,” which is a pair of earrings designed to have a long strip shape. The openwork mesh design gives the earrings a light and airy feel, resembling wings. The earrings are made entirely of silver and are embedded with small sapphires to add a touch of elegance without being overly flashy. The most distinctive feature is the asymmetry between the two earrings. The length and curves of the earrings are designed to be uneven, making them truly unique and one-of-a-kind.','luojing@szu.edu.cn','2024-06-04 21:34:00.588336',1),(109,'Great Heat','Liao Shaoming','产品装备','中国','During the scorching summer days, soothing one’s heart with the delicate clarity of jewelry is a wonderful delight. This inspired me to use “Great Heat,” one of the twenty-four solar terms in the Chinese lunar calendar, as the source of inspiration. Combining this with my personal expression and recent summer theme, I created this hairpin.\n\nFirst Phenomenon: Green Grass, Yellow Fireflies. I chose a mix of yellow and green crushed stones to depict this scene. During the Great Heat term, fireflies hatch from their eggs, and the ancients believed that fireflies were born from decaying grass.\n\nSecond Phenomenon: White shells and silverware as the base, layered to reflect the feature of moist and sweltering heat during the Great Heat period. During this time, the weather starts becoming stuffy, and the land turns damp.\n\nThird Phenomenon: Long strands of transparent beads are used to make tassels, interspersed with green beads. This symbolizes the frequent thunderstorms during the Great Heat period, as the saying goes: “Lightning in the east brings no rain, lightning in the west means downpours.”\n\nThis hairpin attempts to express the unique charm of the Great Heat solar term through the meticulous combination of materials and structure.','luojing@szu.edu.cn','2024-06-04 21:35:03.835919',1);
